import React from "react";
import ReactDOM from "react-dom";
import radhe, {a,test} from "./components/demo1";

ReactDOM.render(
    <>
        <ol>
            <li> Hello </li>
            <li>{radhe}</li>
            <li>{a}</li>
            <li>test()</li>
        </ol>
    </>,
    document.getElementById('root')
);
